import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Define the XSS payload
    const xssPayload = "<script>alert('XSS')</script>";

    // Locate the search input using its placeholder attribute
    const searchInput = page.getByPlaceholder('Search Amazon');
    await searchInput.waitFor({ state: 'visible', timeout: 5000 });

    // Fill the search input with the XSS payload
    await searchInput.fill(xssPayload);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_payload_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_payload_entered.png'));

    // Extract the value to verify it was entered correctly
    const enteredValue = await searchInput.inputValue();

    // Locate the search button immediately following the search input
    const searchButton = page.locator('#searchInput + .search-btn');
    await searchButton.waitFor({ state: 'visible', timeout: 5000 });

    // Click the search button to submit the payload
    await searchButton.click();

    // Wait for a moment to see if anything changes (though we can't detect alerts)
    await page.waitForTimeout(500); // Small static wait to allow potential script execution
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_submit.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_submit.png'));

    return {
      success: true,
      action: "Attempted XSS injection via search input.",
      extractedData: {
        payloadUsed: xssPayload,
        valueInInput: enteredValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to attempt XSS via search input.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
